import React from 'react';


function Button (props){
    
    return(
        <React.Fragment>
           
                <div 
                    className= {props.classname}
                    onClick = {()=>props.onclick()}
                    title = {props.title}
                    type = {props.type}
                    tabIndex = {props.tabindex}
                >    
                    <span
                            className={props.icon}
                            aria-hidden="true"                         
                    >
                    </span>

                </div>

        </React.Fragment>
    )
}

export default Button
